	/// 数据类型ID
	/// </summary>
	public const int dataID=GameRequestType.CRoleR;
	
	public CRoleRRequest()
	{
		_dataID=GameRequestType.CRoleR;
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "CRoleRRequest";
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		base.toWriteBytesFull(stream);
		
		stream.startWriteObj();
		
		stream.endWriteObj();
	}
	
	protected override void copyData()
	{
		base.copyData();
	}
	
	/// <summary>
	/// 创建实例
	/// </summary>
	public static CRoleRRequest create()
	{
		CRoleRRequest re=(CRoleRRequest)BytesControl.createRequest(dataID);
		return re;
	}
	
}
